import React, { Component } from 'react';

const AppContainerStyles = {
  backgroundImage: `url(./images/prism/prism.png)`,
  // backgroundSize: 'cover',
  overflow: 'hidden',
  backgroundRepeat  : 'no-repeat',
  backgroundPosition: 'center',
}

class App extends Component {
  render() {
    return (
      <div className="app_container" style={AppContainerStyles}>
        <h1>Tricky Clicks!</h1>
      </div>
    );
  }
}

export default App;
